export default function Placeholder() {
  return (
    <div className="placeholder">
      <img className="placeholder-image" src="https://res.cloudinary.com/jakepeg/image/upload/v1608193186/placeholder_ufzvpd.png" alt="Placeholder" />
    </div>
  );
}
